import React, { useState, useCallback } from 'react';
import { Form, List} from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 50%;
    margin : 0 auto;
    margin-top: 20px;
`;

const data = [
    '1반',
    '2반',
    '3반',
];ㄴㄴㄴㄴㄴㄴㄴㄴㄴㄴㄴㄴㄴㄴㄴㄴ

const EditUser = () => { 
    return (
        <Form>
            <CenterDiv>
                <List
                size="small"
                dataSource={data}
                renderItem={item => <List.Item>{item}</List.Item>}
                />
            </CenterDiv>
        </Form>
    );
}

export default EditUser;
